import React from 'react';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import { DisasterProvider } from './context/DisasterContext';
import Home from './components/Home';
import Dashboard from './components/Dashboard';
// Remove EmergencyContact import
import AIPrediction from './components/AIPrediction';
import VolunteerRegistration from './components/VolunteerRegistration';
import ResourceManagement from './components/ResourceManagement';

function App() {
  return (
    <DisasterProvider>
      <BrowserRouter>
        <div className="min-h-screen bg-background text-gray-900">
          <nav className="bg-primary text-white p-4 flex space-x-4">
            <Link to="/" className="hover:underline">Home</Link>
            <Link to="/dashboard" className="hover:underline">Dashboard</Link>
            <Link to="/ai-prediction" className="hover:underline">AI Prediction</Link>
            <Link to="/volunteer" className="hover:underline">Volunteer Registration</Link>
            {/* Replace Feedback with Resource Management */}
            <Link to="/resources" className="hover:underline">Resource Management</Link>
          </nav>
          <main className="p-4">
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/dashboard" element={<Dashboard />} />
              <Route path="/ai-prediction" element={<AIPrediction />} />
              <Route path="/volunteer" element={<VolunteerRegistration />} />
              <Route path="/resources" element={<ResourceManagement />} />
            </Routes>
          </main>
        </div>
      </BrowserRouter>
    </DisasterProvider>
  );
}

export default App;
